    unchecked {
        uint256 prod0;
        uint256 prod1;
        assembly {
            let mm := mulmod(a, b, not(0))
            prod0 := mul(a, b)
            prod1 := sub(sub(mm, prod0), lt(mm, prod0))
        }
        if (prod1 == 0) {
            if (!(denominator > 0)) revert Math__DivByZero();
            assembly { result := div(prod0, denominator) }
            return result;
        }
        if (!(denominator > prod1)) revert Math__Overflow();
